import React from "react";
import {Link} from "react-router-dom";
import History from "./History";

const a7 = () => {
    return(
        <>
            <h2>Hello World</h2>
            <Link to="hello">
                Hello
            </Link> | &nbsp;
            <Link to="/a7/practice">
                Practice
            </Link> | &nbsp;
            <Link to="/a7/explore">
                A7-Build
            </Link> | &nbsp;
            <Link to="/a6/twitter/home">
                A6 - Home
            </Link> | &nbsp;
            <Link to="/a6/twitter/explore">
                A6 - Explore
            </Link>| &nbsp;
            <Link to="/a6/practice">
                Practice
            </Link>



            <History />
        </>
    )
};

export default a7;
